            <Text style={globalStyles.header}>REGISZTRÁCIÓ, FELIRATKOZÁS</Text>
            <Text style={globalStyles.success}>Sikeres regisztráció :)</Text>
            <Text style={globalStyles.text}>Másodperceken belül használhatod... :)</Text>
        </View>
    )
};
